export default class ChatListVM {
    private static _chatListVM : ChatListVM | null = null;


    private constructor() {}
    public static getInstance() {
        if(!this._chatListVM) {
            this._chatListVM = new ChatListVM();
        }
        return this._chatListVM;
    }


    getChatList() : [] {
        const id = window.location.href.split('id');
        return [];
    }
}
